To create that balance of cool and warm tones, I love applying a cool base with warm/cool toned highlight. 

@redken Color Gel Lacquers AB (Ash Blue) series is my go to to immediately cancel out the warmth that lives in levels 7 and below. 

#ColorGelLacquers 07AB + 10 volume ( a low volume shifts the base by lifting only 1 to 1.5 levels, this helps not over expose the underlying warmth that lives at the level) 

@redken #ShadesEQBonderInside 09VG (Violet-Gold, brown to tan background) + 010Gi (Gold- Violet,brown to tan background) , only because the hair wasn’t an all over level 9 or 10, I like to play with both levels so I can have the tone but not to tone down. 

I love #ShadesEQ and how creative I can be with my formulas. Remember there is more than one route to get to the same destination. 👌🏾

