Would you believe me if I told you, my clients hair was jet black in May!? 

Color corrections from demi permanent to permanent jet black to blonde is not one size fit all. It can be complicated or super complicated. 😝 no way around it. 

✨ Once dark hair color is lifted, expect extra warm tones. Red and Orange is an underlying tone that lives in darker levels especially with added dark colors. 

✨ Not all hair textures can handle extreme lifting in one appointment to achieve blonde and remember tone is temporary, so until extra warmth is lifted out the hair the orange will return. Refer to the last slide 😝

✨ We were able to see progress in our 2nd session with using 

@redken flash lift bonder inside + 20 volume for highlights 

@redken #shadeseq 07M + 07N for lowlights to cancel out the orange and create dimension 

@redken #ColorGelOils 🤫 , we will discuss at a later date. #NEWNEW

@redken #ShadesEQ 06Nch and 06N for root shadow 

@redken 08VG + 08N for global gloss

